import './App.css';
import React from 'react';

class App extends React.Component {
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <React.Fragment>
              <div className="g-signin2" data-onsuccess="onSignIn" ></div>
            </React.Fragment>

        </header>
      </div>
    );

  }

}

export default App;
